import { useState } from "react";
import { predictPrice } from "../api";

function PriceForm() {
  const [form, setForm] = useState({});
  const [price, setPrice] = useState(null);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const result = await predictPrice(form);
    setPrice(result);
  };

  return (
    <form onSubmit={handleSubmit}>
      <input name="Company" placeholder="Company" onChange={handleChange} />
      <input name="Model" placeholder="Model" onChange={handleChange} />
      <input
        name="Annual Income"
        type="number"
        placeholder="Annual Income"
        onChange={handleChange}
      />
      <input name="Transmission" placeholder="Transmission" onChange={handleChange} />
      <input name="Body Style" placeholder="Body Style" onChange={handleChange} />
      <input name="Dealer_Region" placeholder="Dealer Region" onChange={handleChange} />

      <button type="submit">Predict Price</button>

      {price && <h3>Predicted Price: ${price}</h3>}
    </form>
  );
}

export default PriceForm;
